                          <h5 class="card-title text-center fs-5 fw-bold ">Welcome, James</h5>
                          <p class="card-text mt-3 lead fs-5 text-center">Your Profile</p>                    
                      </div>       
              </div> 
          </div>
          <div className='fs-5 mx text-center mt-2'>Phone Number: <strong>067</strong></div>
          <div className='fs-5 mx text-center mt-2'>Email: </div>
          <div>Email: </div>
          <ProfileForm />
      </div>
    )
}

export default ProfileCard
